import React from "react";
import { useReducer } from "react";

const reducer = (state, action) => {
  switch (action.type) {
    case "increment": {
      state.count = +1;
    }
  }
};

const Reducer = () => {
  const [state, disptach] = userEvent(reducer, { count: 0 });

  return (
    <div>
      <button onClick={() => disptach("increment")}>increment</button>
    </div>
  );
};

export default Reducer;
